const ImagemModal = () => {
    return <div className="imagemmodal">
        <div className="imagemmodal-container">
            <button className="imagemmodal-butclose"></button>
            <div className="imagemmodal-content">goiaba</div>
        </div>
    </div>;
};

export default ImagemModal;
